import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// USERS is an array of objects, which we need to convert into JSX (javascript/react components ?)
import { users } from "../data";


const employeeCard = users.map((users) =>
<div className="card">
    <div className="content">
      <ul>
        <li>
          <strong>ID:</strong>{users.id}
        </li>
        <li>
          <strong>NAME:</strong> {users.name}
        </li>
        <li>
          <strong>DEPARTMENT:</strong> {users.department}
        </li>
        <li>
          <strong>ROLE:</strong> {users.role}
        </li>
        <li>
          <strong>E-MAIL:</strong>{users.email}
        </li>
      </ul>
    </div>
  </div>);

export default employeeCard;

